import React, { useContext } from "react";
import { UserContext } from "../index";

const UserProfile = () => {
  const { user } = useContext(UserContext);

  return (
    <div>
      <h1>Welcome, {user.name}</h1>
      <p>You logged in succesfully</p>
    </div>
  );
};

export default UserProfile;
